import React, { useState } from "react";

const TabelaReservas = ({ reservas, editarReserva, excluirReserva }) => {
  const [filtroData, setFiltroData] = useState("");
  const [filtroHoraInicio, setFiltroHoraInicio] = useState("");
  const [filtroHoraFim, setFiltroHoraFim] = useState("");
  const [filtroQuadra, setFiltroQuadra] = useState("");
  const [filtroLocalizacao, setFiltroLocalizacao] = useState("");
  const [filtroPreco, setFiltroPreco] = useState("");

  const reservasFiltradas = reservas.filter((reserva) => {
    return (
      reserva.data.includes(filtroData) &&
      reserva.horaInicio.includes(filtroHoraInicio) &&
      reserva.horaFim.includes(filtroHoraFim) &&
      reserva.quadra.tipo.includes(filtroQuadra) &&
      reserva.quadra.localizacao.includes(filtroLocalizacao) &&
      reserva.quadra.preco.includes(filtroPreco)
    );
  });

  return (
    <div className="tabela-reservas">
      <div className="filtros">
        <input
          type="text"
          placeholder="Filtrar por data"
          value={filtroData}
          onChange={(e) => setFiltroData(e.target.value)}
        />
        <input
          type="text"
          placeholder="Filtrar por horário início"
          value={filtroHoraInicio}
          onChange={(e) => setFiltroHoraInicio(e.target.value)}
        />
        <input
          type="text"
          placeholder="Filtrar por horário fim"
          value={filtroHoraFim}
          onChange={(e) => setFiltroHoraFim(e.target.value)}
        />
        <input
          type="text"
          placeholder="Filtrar por quadra"
          value={filtroQuadra}
          onChange={(e) => setFiltroQuadra(e.target.value)}
        />
        <input
          type="text"
          placeholder="Filtrar por localização"
          value={filtroLocalizacao}
          onChange={(e) => setFiltroLocalizacao(e.target.value)}
        />
        <input
          type="text"
          placeholder="Filtrar por preço"
          value={filtroPreco}
          onChange={(e) => setFiltroPreco(e.target.value)}
        />
      </div>

      <table className="table mx-auto">
        {/* Cabeçalho da tabela */}
        <thead>
          <tr>
            <th scope="col" className="text-center">
              Data
            </th>
            <th scope="col" className="text-center">
              Horário Início
            </th>
            <th scope="col" className="text-center">
              Horário Fim
            </th>
            <th scope="col" className="text-center">
              Quadra
            </th>
            <th scope="col" className="text-center">
              Localização
            </th>
            <th scope="col" className="text-center">
              Preço
            </th>
            <th scope="col" className="text-center">
              Ações
            </th>
          </tr>
        </thead>
        {/* Corpo da tabela */}
        <tbody>
          {reservasFiltradas.map((reserva) => (
            <tr key={reserva.id}>
              <td className="text-center">{reserva.data}</td>
              <td className="text-center">{reserva.horaInicio}</td>
              <td className="text-center">{reserva.horaFim}</td>
              <td className="text-center">{reserva.quadra.tipo}</td>
              <td className="text-center">{reserva.quadra.localizacao}</td>
              <td className="text-center">{reserva.quadra.preco}</td>
              <td className="text-center">
                {/* Botões de ação para editar e excluir */}
                <button
                  className="btn btn-primary mr-2"
                  onClick={() => editarReserva(reserva.id)}
                >
                  Editar
                </button>
                <button
                  className="btn btn-danger"
                  onClick={() => excluirReserva(reserva.id)}
                >
                  Excluir
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TabelaReservas;
